import { CommonModule } from "@angular/common";
import { NgModule } from "@angular/core";
import { ReactiveFormsModule } from "@angular/forms";
import { StudentListComponent } from "src/app/student-list/student-list.component";
import { StudentFormsComponent } from "src/app/student-forms/student-forms.component";

import { TestListComponent } from "src/app/test-list/test-list.component";
import { StudentService } from "./student.service";
import { HttpClientModule } from "@angular/common/http";
import { RouterModule } from "@angular/router";


@NgModule({
    declarations:[ StudentListComponent, TestListComponent, StudentFormsComponent, AddStudentComponent],
    imports:[CommonModule,ReactiveFormsModule,HttpClientModule,RouterModule],
    providers:[StudentService],
    exports:[ StudentListComponent]
})

export class StudentModule{

}
